import React, { Component } from "react";
import { View,Text,Image } from "react-native";
import { TouchableOpacity } from "react-native-gesture-handler";



export default class Main extends Component{




    render(){
        return(

            <View style={{
                flexDirection:"row",
                height:"100%"
            }}>
                <View style ={{
                    width:"18%",
                    height:"100%",
                    backgroundColor:"#FFFAFA",
                    borderRightWidth:2,
                    borderRightColor:"#880606"

                }}>
                    <View style={{width:"100%",height:"5%",backgroundColor:"#880606"}}>
                        <View style={{height:120,width:280,marginLeft:28,backgroundColor:"#ffffff",shadowRadius:8}}>
                            <Image source={require('./images/MAAN_INSTITUTE_OF_MANAGEMENT_AND_SCIENCE_a-removebg-preview.png')}
                            style={{
                                width:"100%",
                                height:"100%",
                                resizeMode:"contain"
                            }}
                            ></Image>
                            <View style={{flexDirection:"row",marginTop:20}}>
                                <View style={{borderRadius:100,backgroundColor:"white",width:80,height:80}}>
                                    <Image source={require('./images/imagemain.png')}
                                    style={{resizeMode:"contain",width:"100%",height:"100%",borderRadius:100}}
                                    ></Image>

                                </View>
                                <View style={{flexDirection:"column",marginLeft:10,marginTop:10}}>
                                    <Text style={{fontFamily:"YanoneKaffeesatz",fontWeight:"bold",alignSelf:"center",color:"#880606",fontSize:20}}>Khuwaja Hammad</Text>
                                    <Text style={{fontFamily:"YanoneKaffeesatz",fontWeight:"200",color:"#880606",fontSize:20}}>12573</Text>
                                </View>
                            </View>
                            <View style={{
                                flexDirection:"row"
                            }}>
                                <View style={{
                                    width:125,
                                    height:80,
                                    backgroundColor:"#ffffff",
                                    borderRadius:8,
                                    borderWidth:1,
                                    borderColor:"#880606",
                                    alignContent:"center",
                                    alignItems:"center",
                                    justifyContent:"center",marginTop:10
                                }}>
                                    <Text style={{fontFamily:"oswald",fontWeight:"bold",fontSize:22}}>3.22</Text>
                                    <Text style={{fontFamily:"oswald",fontWeight:"400",fontSize:14}}>CGPA</Text>
                                </View>
                                <View style={{
                                    width:125,
                                    marginLeft:10,
                                    height:80,
                                    backgroundColor:"#ffffff",
                                    borderRadius:8,
                                    borderWidth:1,
                                    borderColor:"#880606",
                                    alignContent:"center",
                                    alignItems:"center",
                                    justifyContent:"center",marginTop:10
                                }}>
                                    <Text style={{fontFamily:"oswald",fontWeight:"bold",fontSize:22}}>22</Text>
                                    <Text style={{fontFamily:"oswald",fontWeight:"400",fontSize:14}}>Credit hrs Left</Text>
                                </View>
                                
                            </View>
                            <View style={{
                                width:"100%",
                                height:80,
                                marginTop:20,
                                alignItems:"center",
                                justifyContent:"center",flexDirection:"row",
                                borderTopWidth:1,
                                borderBottomWidth:1,
                                borderBottomColor:"#880606",
                                borderTopColor:"#880606",
                                alignContent:"center"
                            }}>
                                <TouchableOpacity style={{flexDirection:"row"}}>
                                <Image source={require('./images/Untitled_design-removebg-preview.png')}
                                style={{
                                    width:20,height:20,
                                    resizeMode:"contain",
                                    marginRight:10,
                                    marginTop:8
                                }}
                                ></Image>
                                <Text style={{ fontFamily:"oswald",fontWeight:"bold",fontSize:22,color:"#880606"}} >Student Info</Text>
                                </TouchableOpacity>
                                



                            </View>
                        </View>

                    </View>
                </View>
                <View style={{
                    width:"82%",
                    height:"100%",
                    backgroundColor:"#ffffff",
                    flexDirection:"column"
                }}>
                    <View style={{width:"100%",height:"5%",backgroundColor:"#880606",justifyContent:"center",alignContent:"flex-start",alignItems:"flex-start"}}>
                    <Text style={{fontFamily:"YanoneKaffeesatz",fontWeight:"600",alignSelf:"center",color:"#ffffff",fontSize:22}}>WWW.EMAAN.EDU.PK</Text>

                     </View>
                </View>


            </View>
        );
    }

}
